    public FileUploader_ClientService<Profile> UploaderService { get; set; }

    private List<Select> SchoolName { get; set; } = new List<Select>();
    private List<Select> CollegeName { get; set; } = new List<Select>();
    private List<Select> StreamDegree { get; set; } = new List<Select>();


    protected async override Task OnInitializedAsync()
    {
        try
        {
            State = LoadingContainerState.Loading;
            UserService = new User_ClientService(EngineServices.MarketNetwork);
            UploaderService = new FileUploader_ClientService<Profile>(EngineServices.MarketNetwork);

            if (!string.IsNullOrEmpty(UserId))
            {
                UserFullInfo = await UserService.GetUserAndProfileInfoAsync(UserId);
                State = LoadingContainerState.Loaded;
                StateHasChanged();
            }
            foreach (var school in UserFullInfo.ProfileModel.Education.School)
            {
                if (!SchoolList.Contains(school))
                {
                    SchoolList.Add(school);
                }
            }
            foreach (var college in UserFullInfo.ProfileModel.Education.College)
            {
                if (!CollegeList.Contains(college))
                {
                    CollegeList.Add(college);
                }
            }
            foreach (var degree in UserFullInfo.ProfileModel.Education.Degree)
            {

                if (!DegreeList.Contains(degree))
                {
                    DegreeList.Add(degree);
                }
            }

        }
        catch (NullReferenceException e)
        {
            SLog.Write(e.Message);
            State = LoadingContainerState.Error;
        }
    }

    private async void UpdateUserProfileAsync()
    {
        try
        {
            if (!UXUtility.IsNumberOrDigit(UserFullInfo.UserModel.ContactNo.Mobile))
            {
                ToastService.ShowWarning("Please enter valid phone number.", "Only Numbers Allowed");
                return;
            }
            if (UserFullInfo.ProfileModel.ProfileUrl.Trim() == "")
            {
                ToastService.ShowError("Oops! Empty Profile Address");
                return;
            }

            UserFullInfo.ProfileModel.Core.Description = await JSRuntime.InvokeAsync<string>("getEditorValue", "userProfileAbout");
            if (UserFullInfo.ProfileModel.Core.Description == "<p><br></p>")
            {
                ToastService.ShowWarning("Please Try Again :)", "Oops! Empty About Section");
                return;
            }

            UserFullInfo.ProfileModel.Education.School.Clear();
            UserFullInfo.ProfileModel.Education.College.Clear();
            UserFullInfo.ProfileModel.Education.Degree.Clear();
            var data = await JSRuntime.InvokeAsync<Object>("getName", "schoolList");
            SchoolName = JsonConvert.DeserializeObject<List<Select>>(data.ToString());

            var data1 = await JSRuntime.InvokeAsync<Object>("getName", "collegeList");
            CollegeName = JsonConvert.DeserializeObject<List<Select>>(data1.ToString());

            var data2 = await JSRuntime.InvokeAsync<Object>("getName", "degreeList");
            StreamDegree = JsonConvert.DeserializeObject<List<Select>>(data2.ToString());

            if (SchoolName != null)
            {
                foreach (var name in SchoolName)
                {
                    UserFullInfo.ProfileModel.Education.School.Add(name.Text);
                }
            }
            if (CollegeName != null)
            {
                foreach (var name in CollegeName)
                {
                    UserFullInfo.ProfileModel.Education.College.Add(name.Text);
                }
            }
            if (StreamDegree != null)
            {
                foreach (var name in StreamDegree)
                {
                    UserFullInfo.ProfileModel.Education.Degree.Add(name.Text);
                }
            }

            string region = UserFullInfo.UserModel.Address.City + " " + UserFullInfo.UserModel.Address.State + " " + UserFullInfo.UserModel.Address.Country + " " + UserFullInfo.UserModel.Address.Zip;
            Coordinate Location = await UserService.GetCoordinates(region);
            UserFullInfo.UserModel.Address.Lattitude = Location.Latitude;
            UserFullInfo.UserModel.Address.Longitude = Location.Longitude;

            UserFullInfo.UserModel.Name = UserFullInfo.UserModel.FirstName + " " + UserFullInfo.UserModel.LastName;
            UserFullInfo.UserModel.DateOfBirth = await JSRuntime.InvokeAsync<DateTime>("DatePickerValue", "dateOfBirth");

            string response = await UserService.UpdateCombinedUserAndProfileAsync(UserFullInfo);
            if (!string.IsNullOrEmpty(response))
            {
                UserService.UpdateUserCache(UserFullInfo.UserModel);
                LoginService.UpdateLocalStorageForName(UserFullInfo.UserModel);
                LoginService.UpdateLocalStorageForImage(UserFullInfo.ProfileModel.Core.ImageUrl);
                navigationManager.NavigateTo($"profile/{UserId}");
            }
            else
            {
                ToastService.ShowError("Not able to update user and profile details", "Updation Failed!");
            }
        }
        catch (Exception ex)
        {
            SLog.Write(ex);
        }
    }

    public void GetLocation(PhysicalAddress Address)
    {
        UserFullInfo.UserModel.Address.Country = Address.Country;
        UserFullInfo.UserModel.Address.City = Address.City;
        UserFullInfo.UserModel.Address.State = Address.State;
        UserFullInfo.UserModel.Address.Zip = Address.Zip;
        StateHasChanged();
    }

    public async Task OnInputFileChange(InputFileChangeEventArgs e)
    {
        var maxAllowedFiles = 1;
        var format = "image/png";
        foreach (var imageFile in e.GetMultipleFiles(maxAllowedFiles))
        {
            string Ext = imageFile.Name.Substring(imageFile.Name.IndexOf(".") + 1);
            var resizedImageFile = await imageFile.RequestImageFileAsync(format,
            200, 200);
            var buffer = new byte[resizedImageFile.Size];
            await resizedImageFile.OpenReadStream().ReadAsync(buffer);
            var data = Ext + "." + Convert.ToBase64String(buffer);
            UserFullInfo.ProfileModel.Core.ImageUrl = await UploaderService.UploadFile(data);
            StateHasChanged();
        }
    }

